dental touch</li></ul>\n<ul><li>If plan is to print unattended, confirm printer has an overheat sensor to prevent fires. If there is no overheat sensor provided (or not installed such as with a DIY 3D printers), this must be labeled with the following in local language Printer does not have an overheat sensor and CANNOT be left UNATTENDED. This rule must be strictly followed (see picture to right)</li></ul>\n<ul><li>Identify location for the printer with the following: <img alt=\"\" height=\"72\" src=\"https://www.clemson.edu/research/oes/ihsafety/icons/PowerSocket.jpg\" width=\"71\" /> </li></ul>\n<ul><li><ul><li><ul><li>Power outlets and/or data cables, as needed.</li><li>Fire protection systems including fire sprinklers, smoke alarm, and a fire extinguisher nearby. If unable to provide all of these, review with RS.</li><li>Printers operating with non-biodegradable plastics (ABS) cannot be located near employee desks unless they are completely enclosed (sealed) while operating to limit particulate generation in the office.</li></ul></li></ul></li></ul>\n<ul><li>If proposed location is near other employee desks, check with nearby employees and ensure they are okay with proposed location (noise and minimal emissions).</li></ul>\n<ul><li>Confirm location of printer operation and plastic reel storage with facilities (Note: When printer is in use, spool should be able to be located where it can freely turn).</li></ul>\n<ul><li>Establish who will maintain equipment and who will be allowed to use it.<img alt=\"\" height=\"126\" src=\"https://www.clemson.edu/research/oes/ihsafety/icons/Spools.jpg\" width=\"200\" /></li></ul>\n<ul><li>Keep a copy of the local SDS on-site for any material used</li></ul>\n<ul><li>Operate printer and create awesome things!</li></ul>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(324,466,1,'testje','2022-07-20 20:16:35','2022-07-20 20:16:35','7bca3dd1-c317-41e5-bfd5-b66ea2efb3ca',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NUL