ny material used</li></ul><ul><li>Operate printer and create awesome things!</li></ul>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(552,733,2,'satestje','2022-07-24 21:14:41','2022-07-24 21:14:41','f5f04f2e-ed0b-4e43-94be-12b9b94d2520',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p>balbalalbalballababa</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(555,735,1,'Printer 3d nozzle alert outline','2022-07-24 21:21:03','2022-07-24 21:21:03','84679b05-44df-4400-8bc1-b45db9b80bbb',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(556,735,2,'Printer 3d nozzle alert outline','2022-07-24 21:21:03','2022-07-24 21:21:03','62146f35-487a-43a2-a00a-e50a6b2f4828',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(557,736,1,'Printer 3d nozzle alert outline','2022-07-24 21:21:30','2022-07-24 21:21:30','5cbd9362-9c37-49f8-9211-e52119f30cfa',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(558,736,2,'Printer 3d nozzle alert outline','2022-07-24 21:21:30','2022-07-24 21:21:30','53748258-2a3b-4965-9e89-311bbd630fd0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(559,737,1,'3d Printers','2022-07-24 21:25:40','2022-07-24 21:25:40','d98b5d6e-f49b-4c2a-a51a-e8e5a9152958',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p><strong>Hazards:</strong></p><ul><li>Hot surfaces (print head; freshly printed plastic, heated bed)fire or burn hazard</li><li>Moving partspinch point or entanglement hazard</li><li>Particulate emi