1328,2,'Homepage','2022-08-09 20:26:53','2022-08-09 20:26:53','cc5926b4-23d9-445c-bc38-cb051f01472b','Welcome op onze makerSpace web platform','<p>Aan de linkerkant ziet u een lijst van een machine die we in ons lab hebben.</p>\n<p>Klik op de machine die u wilt gebruiken voor verdere instructies</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(992,1328,1,'Homepage','2022-08-09 20:26:53','2022-08-09 20:26:53','074da4ea-85d6-40bd-9105-ee5c638ff691','Welcome to the our Maker Space','<p>Don\'t forget to checkout our socials below, where we post all the cool things we make in the lab!</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(995,1336,1,'3D Printers - safety rules','2022-08-09 21:54:21','2022-08-09 21:54:21','85d022e3-9cd0-44d7-a1e0-cd484f7bbb29',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p><strong><br />Hazards:</strong></p>\n<ul><li>Hot surfaces (print head; freshly printed plastic, heated bed)fire or burn hazard</li><li>Moving partspinch point or entanglement hazard</li><li>Particulate emissionshealth hazard although minimal for biodegradable materials like PLA, ABS is higher</li><li>Electricity shock or fire hazard</li></ul>\n<p><strong>Review new equipment for the following:</strong></p>\n<ul><li>Printer should be labeled in local language with warnings for hot surfaces and moving parts and these labels should be visible in operation. If printer does not come properly labeled, make and apply them. </li></ul>\n<ul><li>Heated printer beds above 80C/176F must be guarded from accidental touch</li></ul>\n<ul><li>If plan is to print unattended, confirm printer has an overheat sensor to prevent fires. If there is no overheat sensor provided (or not installed such as with a DIY 3D printers), this must be labeled with the following in local language Printer does not have an overheat sensor and CANNOT be left UNATTENDED. This rule must be strictly followed (see picture to right)</li></ul>\n<ul><li>Identify location for the printer with the following: <img alt=\"\" height=\"72\" src=\"https://www.clemson.edu/research/oes/ihsafety/icons/PowerSocket.jpg\" width=\"71\" /> </li></ul>\n<ul><li><ul><li><ul><li>Power outlets and/or data cables, as needed.</li><li>Fire protection systems including fire sprinklers, smoke alarm, and a fire extinguisher nearby. If unable to provide all of these, review with RS.</li><li>Printers operating with non-biodegradable plastics (ABS) cannot be located near employee desks unless they are completely enclosed (sealed) while operating to limit particulate generation in the office.</li></ul></li></ul></li></ul>\n<ul><li>If proposed location is near other employee desks, check with nearby employees and ensure they are okay with proposed location (noise and minimal emissions).</li></ul>\n<ul><li>Confirm location of printer operation and plastic reel storage with facilities (Note: When printer is in use, spool should be able to be located where it can freely turn).</li></ul>\n<ul><li>Establish who will maintain equipment and who will be allowed to use it.<img alt=\"\" height=\"126\" src=\"https://www.clemson.edu/research/oes/ihsafety/icons/Spools.jpg\" width=\"200\" /></li></ul>\n<ul><li>Keep a copy of the local SDS on-site for any material used</li></ul>\n<ul><li>Operate printer and create awesome things!</li></ul>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(996,1336,2,'satestje','2022-08-09 21:54:21','2022-08-09 21:54:21','f81119f2-c0fe-44b8-91c9-fe9bbe0c0ba3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(997,1337,1,'3D Printers - safety rules','2022-08-09 21:54:29','2022-08-09 21:54:29','732664aa-7c44-4b47-9