r employee desks, check with nearby employees and ensure they are okay with proposed location (noise and minimal emissions).</li></ul>\n<ul><li>Confirm location of printer operation and plastic reel storage with facilities (Note: When printer is in use, spool should be able to be located where it can freely turn).</li></ul>\n<ul><li>Establish who will maintain equipment and who will be allowed to use it.<img alt=\"\" height=\"126\" src=\"https://www.clemson.edu/research/oes/ihsafety/icons/Spools.jpg\" width=\"200\" /></li></ul>\n<ul><li>Keep a copy of the local SDS on-site for any material used</li></ul>\n<ul><li>Operate printer and create awesome things!</li></ul>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1006,1341,2,'satestje','2022-08-09 21:56:05','2022-08-09 21:56:05','04174fd6-fca6-4fae-ba06-d3f34f6188c5',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1009,1343,1,'Machien 1','2022-08-09 22:16:16','2022-08-09 22:16:16','75e03339-3605-4518-b71b-d1e66f6a5cef',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1010,1343,2,'Machien 1','2022-08-09 22:16:16','2022-08-09 22:16:16','5ddbace5-73a9-4314-bdd7-7517b076561c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1011,1344,1,'Nerdlab','2022-08-09 22:16:17','2022-08-09 22:16:17','6fa0f110-21a9-4492-a196-b10550f5a1c5',NULL,NULL,NULL,NULL,NULL,NULL,'Voetweg 66, 9000 Gent','[{\"open\":\"2022-07-18 21:00:00\",\"close\":\"2022-07-18 01:30:00\"},{\"open\":\"2022-07-17 22:00:00\",\"close\":\"2022-07-17 22:30:00\"},{\"open\":\"2022-07-17 23:00:00\",\"close\":\"2022-07-18 00:00:00\"},{\"open\":\"2022-07-18 00:00:00\",\"close\":\"2022-07-17 23:30:00\"},{\"open\":\"202